            heroImg="https://images.unsplash.com/photo-1503220317375-aaad61436b1b?ixlib=rb-4.0.3&ixid=M3wxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8fA%3D%3D&auto=format&fit=crop&w=1170&q=80"
            title="Your Journey Your Story"
            text="Choose Your Destination"
            buttonText="Travel Plan"
            url="/"
            btnClass="show"
            />
            
       </>
    )

}


export default Home;
